    "e-verify",nt"isopen": true,nt"url": null,nt"notes": "Through an
    automated confirmation system, an employer matches information provided by a new
    employee (Form I-9) against existing information contained in Social Security Administration's
    (SSA) and the Department of Homeland Security's (DHS) U.S. Citizenship & Immigration
    Services (USCIS) databases. The SSA E-Verify System (SSA E-Verify) determines a
    specific verification code based upon information (SSN, DOB, L-Name, F-Name) in
    the NUMIDENT database. The verification code is returned to DHS E-Verify (DHS E-Verify)
    along with the original verification request. The message to the employer is determined
    by DHS E-Verify based on SSA's verification code.",nt"license_title": "Other
